webpackJsonp([35214607255981],{"./node_modules/json-loader/index.js!./.cache/json/contribute.json":function(e,t){e.exports={data:{markdownRemark:{html:'<h2>People</h2>\n<p>Describe who\'s involved in changes to the system. Describe who\'s expected to do the work and who approves changes.</p>\n<h2>Process</h2>\n<p>Describe specifically the process or processes by which the system gets <a href="http://atomicdesign.bradfrost.com/chapter-5/#making-changes-to-patterns">updated</a>. What happens when existing component need modified? What if an entire new component needs created? What happens if a component is deprecated? See <a href="http://design.canonical.com/2016/07/getting-vanilla-ready-for-v1-the-roadmap/">Canonical\'s fantastic decision tree</a> for contributing changes to their design system.</p>\n<p>Since a design system is made up of component code, guidelines, documentation, design tools, and resources, keep in mind you\'ll likely need to define several processes to contribute each of these ingredients.</p>\n<h2>Support</h2>\n<p>Cross-linking to the <a href="/support">support page</a> is a good idea here.</p>',frontmatter:{path:"/contribute",tags:null,kicker:"The right stuff",title:"Contributing to the design system",description:"This page explains the process (or processes) by which the design system gets updated",status:null,group:null,usage:null,use:null,altUse:null}}},pathContext:{slug:"/contribute/"}}}});
